import re from 'pages/Dash';
import dash from 'pages/Dash';
import home from 'pages/Home';
import landing from 'pages/Landing';

import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";


const App = () => {
    return (
        <div>

            <BrowserRouter>
                <Switch>

                    <Route path="/landing">
                        <landing />
                    </Route>

                    <Route path="/home">
                        <home />
                    </Route>

                    <Route path="/dash">
                        <dash />
                    </Route>


                </Switch>
            </BrowserRouter>
        </div>
    )
}

export default App
